import PrivateRoute from './PrivateRoute';

function App() {
    return (
        <AuthProvider>
            <Router>
                <Routes>
                    <Route path="/login" element={<Login />} />
                    <Route path="/register" element={<Register />} />
                    <Route path="/" element={<HomePage />} />
                    <Route path="/shayari/:id" element={<ShayariDetail />} />
                    <Route
                        path="/add-shayari"
                        element={
                            <PrivateRoute>
                                <AddShayari />
                            </PrivateRoute>
                        }
                    />
                </Routes>
            </Router>
        </AuthProvider>
    );
}
